import React from "react";

class Cart extends React.Component {

  render() {
		console.log(JSON.parse(localStorage.getItem('Products')||'[]'));
		var tab = localStorage.getItem('Products');
		var tmp = [];
		tab.each(function(index, value) {
			tmp.push(value);
		});	

		console.log(tmp);
	if (tmp === []) {
			return <div></div>
	}
		else {


		    return (
      <div class="container">
				{tab.map(product=> (
					<div>
							{product}
					</div>
				))}

      </div>
    );
	}
}
}
export default Cart;
